import React, {useState} from 'react';
import './App.css';
import {Message} from './components/Message.js'

function App() {
  let [ count, setCount] = useState(0)
  return (
    <div className="App">
      <header className="App-header">
       <Message counter= {count}></Message>
       <br/>
       <button onClick={
         ()=> setCount(count + 1)
       }>Value update</button>
      </header>
    </div>
  );
}

export default App;
